import React from "react";
import { useState } from "react";
import "./index.css";


const App = () => {
  const purple = "#fab1a0";
  const [bg,setBg ] = useState(purple);
  const [name, setName] = useState("Click Me");

  const bgChange=()=>{
    const clor = "#fd79a8";
    setBg(clor);
    setName("Ouch!! ðŸ˜§");
  }
  const changeBg=()=>{
    const clor = "#ffeaa7";
    setBg(clor);
    setName("Oh Teri!! ðŸ˜  ");
  }
  
  return (
    <>
   <div style={{ backgroundColor: bg }}>
   <button onClick={bgChange} onClick={changeBg}>{name}</button>
   </div>
    </>
  )
}
export default App;
